    private void onStartimechage(string starttime)
    {
        string date = int.Parse(starttime).ToString("D4");
        if (BusScheduleHelper.CheckTimeinDay(date))
        {
            itembuschoosemenu.TimeStart = int.Parse(starttime.ToString());
