        DateTime.TryParseExact(startdate + starttime,
                       "yyyyMMddHHmm",
                       CultureInfo.CurrentCulture,
                       DateTimeStyles.None,
                       out startdatene);

        DateTime enddatene;
        DateTime.TryParseExact(enddate + endtime,
                       "yyyyMMddHHmm",
                       CultureInfo.CurrentCulture,
                       DateTimeStyles.None,
                       out enddatene);
        if (startdatene > enddatene)
        {
            popuprpcheck = true;
        }
        else
        { popuprpcheck = false; }
    }
